import ProductSale from "../components/ProductSale";
import imgOne from "../images/browitem.jpeg";
import imgTwo from "../images/browset.jpeg";
import imgThree from "../images/eyebrowpen.jpeg";
import imgFour from "../images/eyebrowwax.png";

const Featured = () => {
    const items = [
        {
            key: "img01",
            src: imgOne,
            name: "Benefit Brow Gel",
            price: "$25.00",
            alt: "Brow Gel",
        },
        {
            key: "img02",
            src: imgTwo,
            name: "Benefit Brow Set",
            price: "$30.00",
            alt: "Brow Gel Set",
        },
        {
            key: "img02",
            src: imgThree,
            name: "Benefit Long Lasting Brow Pen",
            price: "$30.00",
            alt: "Brow Gel Set",
        },
        {
            key: "img02",
            src: imgFour,
            name: "Benefit Brow Wax",
            price: "$30.00",
            alt: "Brow Gel Set",
        },
    ];

    return (
        <section>
            <h1 class="Bodoni">All About Brows</h1>
            <div class="featured">
                <div class="featured-items">
                    {items.map((a) => {
                        return (
                            <ProductSale
                                key={a.key}
                                src={a.src}
                                name={a.name}
                                price={a.price}
                                alt={a.alt}
                                class="grid-item"
                            />
                        );
                    })}
                </div>
                <div class="featured-image">
                    <img src={require('../images/browad.jpeg')} alt="Brow Ad" /> </div>
            </div>
        </section>
    );
};

export default Featured;
